class JiomartSpider(scrapy.Spider):
    name = 'JIOMART'
    allowed_domains = ['*']
    start_urls=url
   
    
    def start_requests(self):

        payloadlocal=payload.format(catid=catid,storecode=storecode,numeric='')

        yield scrapy.Request(url=url,callback=self.parse,method='POST',body=(payloadlocal),dont_filter=True)
    

    def parse(self, response):

        item=JiomartItem()

        data=json.loads(response.body)

        nbhits=data['results'][0]['nbHits']
        
        

        if nbhits<=1000:


            for i in range(nbhits):
        

                item['productcode']=data['results'][0]['hits'][i]['product_code']
                item['displayname']=data['results'][0]['hits'][i]['display_name']
                item['mrp']=data['results'][0]['hits'][i]['store_wise_mrp'][str(storecode)]['mrp']
                item['availablility_status']=data['results'][0]['hits'][i]['availability_status']
                item['urlpath']=data['results'][0]['hits'][i]['url_path']
                item['imageurl']=data['results'][0]['hits'][i]['url_path']

                
                yield(item)

        else:
            
            minval=data['results'][0]['facets_stats']['avg_selling_price']['min']
            
            maxval=data['results'][0]['facets_stats']['avg_selling_price']['max']
            
            div=(minval+maxval)/2
            
            numeric1=f'&numericFilters=%5B%22avg_selling_price%3E%3D{div}%22%2C%22avg_selling_price%3C%3D{maxval}%22%5D'
            numeric2=f'&numericFilters=%5B%22avg_selling_price%3E%3D{minval}%22%2C%22avg_selling_price%3C%3D{div}%22%5D'

            payloadlocal1=payload.format(catid=catid,storecode=storecode,numeric=numeric1)
            payloadlocal2=payload.format(catid=catid,storecode=storecode,numeric=numeric2)

            yield scrapy.Request(url=url,callback=self.parse,method='POST',body=(payloadlocal1),dont_filter=True)
            yield scrapy.Request(url=url,callback=self.parse,method='POST',body=(payloadlocal2),dont_filter=True)